oxy_webhelp_navlinks = {"rbk_cdm_software_upgrade-d22908e3707":{"topics":[{"title":"Rubrik CDM release information","shortdesc":"<p class=\"shortdesc\">The Rubrik CDM release information includes details such as release date, end of         support date, and current adoption rate. You can use this information to compare the         available versions for making a decision about upgrading.<\/p>","href":"saas\/rubrik_cdm_release_information.html","attributes":{"data-id":"rubrik_cdm_release_information"},"menu":{"hasChildren":false},"tocID":"rubrik_cdm_release_information-d22908e3718","next":"rubrik_cdm_release_information-d22908e3718"},{"title":"Rolling upgrade of Rubrik CDM software","shortdesc":"<p class=\"shortdesc\">To minimize any potential downtime for your Rubrik clusters, you can perform the         rolling upgrade of Rubrik CDM software running your Rubrik cluster.<\/p>","href":"saas\/rolling_upgrade_rbk_cdm_software.html","attributes":{"data-id":"rolling_upgrade_rbk_cdm_software"},"menu":{"hasChildren":false},"tocID":"rolling_upgrade_rbk_cdm_software-d22908e3765","next":"rolling_upgrade_rbk_cdm_software-d22908e3765"},{"title":"Fast upgrade of Rubrik CDM software","shortdesc":"<p class=\"shortdesc\">With the fast upgrade of Rubrik CDM software running on your Rubrik cluster, you can         simultaneously upgrade all Rubrik cluster nodes. This option saves time but requires some         system downtime.<\/p>","href":"saas\/fast_upgrade_rbk_cdm_software.html","attributes":{"data-id":"fast_upgrade_rbk_cdm_software"},"menu":{"hasChildren":false},"tocID":"fast_upgrade_rbk_cdm_software-d22908e3809","topics":[]},{"title":"Upgrade preparation and prechecks","shortdesc":"<p class=\"shortdesc\">You can prepare the Rubrik CDM cluster for an upgrade process that also automatically         includes a series of prechecks.<\/p>","href":"saas\/upgrade_preparation_and_prechecks.html","attributes":{"data-id":"upgrade_preparation_and_prechecks"},"menu":{"hasChildren":false},"tocID":"upgrade_preparation_and_prechecks-d22908e3820","next":"upgrade_preparation_and_prechecks-d22908e3820"},{"title":"Rubrik CDM software upgrade using <span class=\"ph\">RSC<\/span>","shortdesc":"<p class=\"shortdesc\">To take advantage of the latest features and improvements that Rubrik offers, you can         upgrade the Rubrik CDM version running on any connected Rubrik cluster to the latest version         using <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/rbk_cdm_soft_upgrade_rsc.html","attributes":{"data-id":"rbk_cdm_soft_upgrade_rsc"},"menu":{"hasChildren":false},"tocID":"rbk_cdm_soft_upgrade_rsc-d22908e3853","next":"rbk_cdm_soft_upgrade_rsc-d22908e3853"},{"title":"Rubrik CDM software upgrade using CLI","shortdesc":"<p class=\"shortdesc\">To take advantage of the latest features and improvements that Rubrik offers, you can         upgrade the Rubrik CDM version running on any connected Rubrik cluster to the latest version         using Rubrik CLI.<\/p>","href":"saas\/rubrik_cdm_upgrade_using_cli.html","attributes":{"data-id":"rubrik_cdm_upgrade_using_cli"},"menu":{"hasChildren":false},"tocID":"rubrik_cdm_upgrade_using_cli-d22908e3962","next":"rubrik_cdm_upgrade_using_cli-d22908e3962"},{"title":"Downloading the Rubrik cluster upgrade report","shortdesc":"<p class=\"shortdesc\">Download and view the Rubrik cluster upgrade report for monitoring or         auditing.<\/p>","href":"saas\/downloading_the_rubrik_cluster_upgrade_report.html","attributes":{"data-id":"downloading_the_rubrik_cluster_upgrade_report"},"menu":{"hasChildren":false},"tocID":"downloading_the_rubrik_cluster_upgrade_report-d22908e4061","next":"downloading_the_rubrik_cluster_upgrade_report-d22908e4061"}]}};